window.bookSummaryJSON = "<p><b><i>A child conceived ’neath moon so bright…</i></b></p> <p>When it comes to the cryptic Moon Blessed prophecy, our enemies have been fighting over its meaning—and its dark magic—for millennia.</p> <p><b><i>Born of the union of darkness and light…</i></b></p> <p>But through all their bitter skirmishes, there’s one <i>teeny</i> little detail the vile beasts keep forgetting:</p> <p>The Moon Blessed witch herself.</p> <p><b><i>Blessed is the babe who inherits the crown…</i></b></p> <p>And after everything I’ve been through? <i>This</i> witch is <i>done</i> being forgotten. Done being manipulated. Done letting everyone else decide my fate.</p> <p><b><i>Blessed is the blood that brings the world down…</i></b></p> <p>It’s time to write my <i>own</i> destiny.</p> <p>Time to show our enemies just how hard a dark-fae witch and four cursed gargoyles will fight to protect the only thing more powerful than all the prophecies in the realms…</p> <p>Love.</p> <p><i>Wicked Ascending is the fourth and final book in the Claimed by Gargoyles series, a scorching hot paranormal mafia romance featuring a feisty witch coming into her power and four fiercely possessive gargoyle gangsters with horns, tails, oh-so-sensitive wings, and special “equipment” guaranteed to leave their woman—and their audiences—begging for more.</i></p>"; 
